class Vocab(object):

  PAD = 0
  SOS = 1
  EOS = 2
  UNK = 3


  def __init__(self):
    self.word2index = {}
    self.word2count = Counter()
    self.reserved = ['<PAD>', '<SOS>', '<EOS>', '<UNK>']
    self.index2word = self.reserved[:]
    self.embeddings = None

  def add_words(self, words):
    for word in words.split(" "):
      if word not in self.word2index:
        self.word2index[word] = len(self.index2word)
        self.index2word.append(word)
    self.word2count.update(words)

  def load_embeddings(self, file_path):
    num_embeddings = 0
    vocab_size = len(self)
    with open(file_path, encoding='utf-8') as f:
      for line in f:
        line = line.split()
        idx = self.word2index.get(line[0])
        if idx is not None: #ie. we have the word
          coefs = np.array(line[1:], dtype='float32')
          if self.embeddings is None:
            self.embeddings = np.random.normal(np.zeros((vocab_size, len(coefs)))).astype(dtype)
            self.embeddings[self.PAD] = np.zeros(len(coefs))
          self.embeddings[idx] = coefs
          num_embeddings += 1
    return num_embeddings

  def __getitem__(self, item):
    #if type(item) is int: return self.index2word[item]
    return self.word2index.get(item, self.UNK)

  def __len__(self):
    return len(self.index2word)

  #def is_word(self, token_id):
    #if token_id < 4: return False
    #token_str = self.index2word[token_id]
    #if not re.compile('\w').search(token_str) or token_str == '<P>':
      #return False
    #return True

class OOVDict(object):

  def __init__(self, base_oov_idx):
    self.word2index = {}  # type: Dict[Tuple[int, str], int]
    self.index2word = {}  # type: Dict[Tuple[int, int], str]
    self.next_index = {}  # type: Dict[int, int]
    self.base_oov_idx = base_oov_idx
    self.ext_vocab_size = base_oov_idx

  def add_word(self, idx_in_batch, word):
    key = (idx_in_batch, word)
    #key = word
    index = self.word2index.get(key)
    if index is None: 
      index = self.next_index.get(idx_in_batch, self.base_oov_idx)
      self.next_index[idx_in_batch] = index + 1
      self.word2index[key] = index
      self.index2word[(idx_in_batch, index)] = word
      self.ext_vocab_size = max(self.ext_vocab_size, index + 1)
    return index

